(113, 'widget_custom_html', 'a:5:{i:3;a:2:{s:5:\"title\";s:14:\"Sobre nosotros\";s:7:\"content\";s:398:\"<p style=\"text-align: justify;\">Somos un grupo de trabajo integrado por profesionales de la electrónica, la automática y la industria, con vasta experiencia en los servicios de reparación y mantenimiento a sistema y equipos de pesaje e industriales, garantizando desde el diagnóstico, el montaje y puesta en marcha, hasta la garantía y los servicios de post-venta, todos a su disposición.</p>\";}i:4;a:2:{s:5:\"title\";s:17:\"Sobre los precios\";s:7:\"content\";s:435:\"<p style=\"text-align: justify;\">\r\n	Según se establece en la ley de las cooperativas los precios son por oferta y demanda por lo que usted tiene el derecho de conveniar los precios con nosotros antes de facturar. Los precios de los servicios están en dependencia de las características de este, Simple, Medio o Capital, el tipo de celda, visor, su capacidad, know how, según la complejidad, calidad del servicio, destino, etc.\r\n</p>\";}i:5;a:2:{s:5:\"title\";s:12:\"Contáctenos\";s:7:\"content\";s:379:\"<address>Calle 76 esq. 23 Buenavista, <br>Playa.       La Habana, Cuba</address>\r\n\r\n------------------------<br>\r\n<abbr title=\"Phone\">Teléfono:</abbr> (+53) 7202 5974 <br>\r\n<abbr title=\"Mobile\">Móvil:</abbr> 5 264 5105\r\n<br> \r\n<abbr title=\"Email\">Correo:</abbr>  <a href=\"mailto:servelec@nauta.cu\">servelec@nauta.cu</a> <br>\r\n\r\n<abbr title=\"Website\">Web:</abbr> www.servelec.cu\";}i:7;a:3:{s:5:\"title\";s:14:\"Más demandado\";s:7:\"content\";s:241:\"<img src=\"https://servelec.test/wp-content/uploads/2020/06/154007e7-e4e7-42fe-b2b5-1d2daa971f4f.png\" alt=\"celdas\">\r\n\r\n<hr>\r\n\r\n<img src=\"https://servelec.test/wp-content/uploads/2020/07/4e02ecf2-589b-4e49-9925-542af9c4f692.png\" alt=\"visores\">\";s:8:\"pll_lang\";s:2:\"es\";}s:12:\"_multiwidget\";i:1;}', 'yes'),
