(1120, 'nimble_api_news_data', 'a:4:{i:0;a:4:{s:5:\"title\";s:67:\"✅Hueman free and pro are fully compatible with WordPress 5.5 🔂\";s:7:\"excerpt\";s:340:\"Dear Hueman theme users, Just a quick release note to let you know that you can safely update Hueman free (v3.6.0) and Hueman Pro (v1.3.0) with the upcoming version 5.5 of WordPress. &nbsp; Changelog : Hueman has been successfully tested with WordPress 5.5 fixed : [forms] padding in select input breaks text readability. fixed : [&hellip;]\";s:7:\"created\";s:19:\"2020-07-21 16:02:06\";s:3:\"url\";s:87:\"https://presscustomizr.com/hueman-free-and-pro-are-fully-compatible-with-wordpress-5-5/\";}i:1;a:4:{s:5:\"title\";s:66:\"⚙️ Release note for Hueman Pro v1.2.13 and Hueman free v3.5.11\";s:7:\"excerpt\";s:323:\"Dear Hueman theme users, In this new release, we have added a new option to display the author in post grids. The option is located in the customizer ▸ Main Body Design ▸ Post Lists Design and Content. This new release fixes various other minor problems listed in the changelog below. Hueman themes have been [&hellip;]\";s:7:\"created\";s:19:\"2020-06-14 21:11:48\";s:3:\"url\";s:106:\"https://presscustomizr.com/%e2%9a%99%ef%b8%8f-release-note-for-hueman-pro-v1-2-13-and-hueman-free-v3-5-11/\";}i:2;a:4:{s:5:\"title\";s:55:\"💾 Save and reuse sections with Nimble Builder v2.1.0\";s:7:\"excerpt\";s:520:\"Dear Nimble Builder users, You can now save your sections and reuse them in any page of your WordPress website. Documented here :https://docs.presscustomizr.com/article/417-how-to-save-and-reuse-sections-with-nimble-builder Recently introduced SEO : Integration with Yoast SEO and SEOPress https://docs.presscustomizr.com/article/388-nimble-builder-and-seo &nbsp; Compatibility with Membership plugins Nimble Builder is compatible with some of the most popular WordPress membership plugins : Simple Membership [&hellip;]\";s:7:\"created\";s:19:\"2020-06-10 15:03:50\";s:3:\"url\";s:74:\"https://presscustomizr.com/nimble-builder-2-1-0-introduces-section-saving/\";}i:3;a:4:{s:5:\"title\";s:99:\"⚙️ New options for social links and font customizer in Hueman Pro v1.2.9 and Hueman free v3.5.7\";s:7:\"excerpt\";s:333:\"Dear Hueman theme users, In this new release, we have added new options to control the visibility of the social links in the sidebar and the footer. You&#8217;ll find them in the customizer &gt; content &gt; footer, and customizer &gt; content &gt; sidebar. In Hueman Pro, you can now decide to disable the Font Customizer [&hellip;]\";s:7:\"created\";s:19:\"2020-05-16 17:07:05\";s:3:\"url\";s:120:\"https://presscustomizr.com/new-options-for-social-links-and-font-customizer-in-hueman-pro-v1-2-9-and-hueman-free-v3-5-7/\";}}', 'no'),
