(1, 1, '2020-06-28 00:06:22', '2020-06-28 00:06:22', '<!-- wp:paragraph -->\n<p>Bienvenido a WordPress. Esta es tu primera entrada. Edítala o bórrala, ¡luego empieza a escribir!</p>\n<!-- /wp:paragraph -->', '¡Hola, mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2020-06-28 00:06:22', '2020-06-28 00:06:22', '', 0, 'https://servelec.test/?p=1', 0, 'post', '', 1),
(2, 1, '2020-06-28 00:06:22', '2020-06-28 00:06:22', '<!-- wp:html -->\n<p style=\"text-align: justify;\"><strong>Somos una cooperativa no agropecuaria (C.N.A),especializada en la reparación, mantenimiento y puesta en marcha de sistemas y equipos de pesaje e industriales, brindando garantías y servicios de post-venta a nivel nacional, &nbsp;con un trabajo sostenido de más de 15 años hemos logrando ser&nbsp; líderes de este mercado a nivel nacional.</strong><strong></strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"className\":\"p { text-align: justify; }\"} -->\n<p class=\"p { text-align: justify; }\">Nuestro mayor compromiso es satisfacer las distintas demandas que existen en el mercado de la metrología con la mejor calidad, eficiencia y eficacia que nos caracteriza, brindándole a nuestros clientes &nbsp;la más alta excelencia en los servicios, garantizando confianza y distinción.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[97,96,98],\"align\":\"center\"} -->\n<figure class=\"wp-block-gallery aligncenter columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://servelec.test/wp-content/uploads/2020/06/814a1ae5-04be-4a10-92d5-e9c81c22f844.png\" alt=\"814a1ae5-04be-4a10-92d5-e9c81c22f844\" data-id=\"97\" data-full-url=\"https://servelec.test/wp-content/uploads/2020/06/814a1ae5-04be-4a10-92d5-e9c81c22f844.png\" data-link=\"https://servelec.test/pagina-ejemplo/814a1ae5-04be-4a10-92d5-e9c81c22f844/#main\" class=\"wp-image-97\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://servelec.test/wp-content/uploads/2020/06/9addaac5-46c3-4daf-bfc8-adfdc57192db.png\" alt=\"9addaac5-46c3-4daf-bfc8-adfdc57192db\" data-id=\"96\" data-full-url=\"https://servelec.test/wp-content/uploads/2020/06/9addaac5-46c3-4daf-bfc8-adfdc57192db.png\" data-link=\"https://servelec.test/pagina-ejemplo/9addaac5-46c3-4daf-bfc8-adfdc57192db/#main\" class=\"wp-image-96\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://servelec.test/wp-content/uploads/2020/06/2f5cb821-8110-40f7-a7a4-6bc23adae9cf.png\" alt=\"2f5cb821-8110-40f7-a7a4-6bc23adae9cf\" data-id=\"98\" data-full-url=\"https://servelec.test/wp-content/uploads/2020/06/2f5cb821-8110-40f7-a7a4-6bc23adae9cf.png\" data-link=\"https://servelec.test/pagina-ejemplo/2f5cb821-8110-40f7-a7a4-6bc23adae9cf/#main\" class=\"wp-image-98\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Nuestros proyectos se han desarrollado en diferentes áreas de la economía cubana, donde se han dado solución a todos los problemas a los que nuestro equipo se ha enfrentado, la Empresa de Materias Primas, Ferrocarriles, Graneleras, CUBA RON, etc. empresas líderes de todo el país que  mantienen contratos con SERVELEC, para garantizar la eficiencia y precisión de sus básculas.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p><strong>Anuncios Recientes</strong>:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p><em>Servelec surgió en Febrero del 2012 a partir de los Lineamientos aprobados en la&nbsp; Asamblea Nacional como una organización de trabajo por cuenta propia y en Septiembre del 2013 pasamos a ser una cooperativa no&nbsp; agropecuaria donde hemos continuado nuestros trabajos a lo largo de todo el país creciendo en todos nuestros servicios.</em></p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":12,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large\"><img src=\"https://servelec.test/wp-content/uploads/2020/06/firma-lauka1.jpg\" alt=\"\" class=\"wp-image-12\"/><figcaption><em>EUSLAUKA KONDEFF PEREZ</em></figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Quiénes somos', '', 'publish', 'closed', 'open', '', 'pagina-ejemplo', '', '', '2020-06-29 16:50:35', '2020-06-29 16:50:35', '', 0, 'https://servelec.test/?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-06-28 00:06:22', '2020-06-28 00:06:22', '<!-- wp:heading --><h2>Quiénes somos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>La dirección de nuestra web es: https://servelec.test.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Qué datos personales recogemos y por qué los recogemos</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comentarios</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, así como la dirección IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la detección de spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Una cadena anónima creada a partir de tu dirección de correo electrónico (también llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la estás usando. La política de privacidad del servicio Gravatar está disponible aquí: https://automattic.com/privacy/. Después de la aprobación de tu comentario, la imagen de tu perfil es visible para el público en el contexto de tu comentario.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Medios</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si subes imágenes a la web, deberías evitar subir imágenes con datos de ubicación (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de ubicación de las imágenes de la web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formularios de contacto</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, dirección de correo electrónico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendrán una duración de un año.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Cuando accedas, también instalaremos varias cookies para guardar tu información de acceso y tus opciones de visualización de pantalla. Las cookies de acceso duran dos días, y las cookies de opciones de pantalla duran un año. Si seleccionas «Recuérdarme», tu acceso perdurará durante dos semanas. Si sales de tu cuenta, las cookies de acceso se eliminarán.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si editas o publicas un artículo se guardará una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del artículo que acabas de editar. Caduca después de 1 día.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenido incrustado de otros sitios web</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Los artículos de este sitio pueden incluir contenido incrustado (por ejemplo, vídeos, imágenes, artículos, etc.). El contenido incrustado de otras webs se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interacción con ese contenido incrustado, incluido el seguimiento de tu interacción con el contenido incrustado si tienes una cuenta y estás conectado a esa web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analítica</h3><!-- /wp:heading --><!-- wp:heading --><h2>Con quién compartimos tus datos</h2><!-- /wp:heading --><!-- wp:heading --><h2>Cuánto tiempo conservamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos automáticamente, en lugar de mantenerlos en una cola de moderación.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>De los usuarios que se registran en nuestra web (si los hay), también almacenamos la información personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su información personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web también pueden ver y editar esa información.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Qué derechos tienes sobre tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportación de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. También puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ningún dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Dónde enviamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Los comentarios de los visitantes puede que los revise un servicio de detección automática de spam.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Tu información de contacto</h2><!-- /wp:heading --><!-- wp:heading --><h2>Información adicional</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cómo protegemos tus datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Qué procedimientos utilizamos contra las brechas de datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>De qué terceros recibimos datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Qué tipo de toma de decisiones automatizada y/o perfilado hacemos con los datos del usuario</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Requerimientos regulatorios de revelación de información del sector</h3><!-- /wp:heading -->', 'Política de privacidad', '', 'draft', 'closed', 'open', '', 'politica-privacidad', '', '', '2020-06-28 00:06:22', '2020-06-28 00:06:22', '', 0, 'https://servelec.test/?page_id=3', 0, 'page', '', 0),
