(141, 1, '2020-06-29 18:24:37', '2020-06-29 18:24:37', '<!-- wp:paragraph -->\n<p><em><span><b>Sistema de Pesaje - </b></span><strong>Hormigonera </strong></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Se realizó un mantenimiento general en la Báscula de Camiones de 60 T que consistió en:</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":142,\"mediaType\":\"image\",\"verticalAlignment\":\"top\",\"imageFill\":false} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile is-vertically-aligned-top\"><figure class=\"wp-block-media-text__media\"><img src=\"https://servelec.test/wp-content/uploads/2020/06/sistemas_Varadero.png\" alt=\"sistemas_Varadero\" class=\"wp-image-142\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:list -->\n<ul><li><em>Desmontaje de las 8 celdas de carga.</em></li><li><em>Pesaje de la estructura metálica de la báscula (puente metálico 18x3m).</em></li><li><em>Limpieza del área donde se encontraba la báscula y raspado y pintura de base de celdas.</em></li><li><em>Raspado y pintura de las estructuras (puente metálico).</em></li><li><em>Ubicación de la estructura en las bases de las celdas.</em></li><li><em>Montaje, cableado y conexión de las celdas de carga (8).</em></li><li><em>Ajuste y Calibración</em></li></ul>\n<!-- /wp:list --></div></div>\n<!-- /wp:media-text -->', 'Hormigonera - Varadero', 'Se realizó un mantenimiento general en la Báscula de Camiones de 60 T...', 'publish', 'closed', 'closed', '', 'hormigonera-varadero', '', '', '2020-06-29 18:28:37', '2020-06-29 18:28:37', '', 0, 'https://servelec.test/?post_type=proyecto&#038;p=141', 0, 'proyecto', '', 0),
